import React, { useState, useEffect } from 'react';
import { getFundData, getTransactionHistory } from '../api/web3';
import { Chart as ChartJS, ArcElement, Tooltip, Legend, CategoryScale, LinearScale, PointElement, LineElement, Title, BarElement } from 'chart.js';
import { Pie, Bar } from 'react-chartjs-2';

ChartJS.register(ArcElement, CategoryScale, LinearScale, PointElement, LineElement, BarElement, Title, Tooltip, Legend);

export default function Fund() {
  const [fundData, setFundData] = useState({
    totalSupply: '0',
    totalShares: '0',
    owner: 'Loading...',
    tokenAddress: 'Loading...',
  });

  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const [transactionChart, setTransactionChart] = useState({
    labels: [],
    datasets: [
      {
        label: 'Deposits',
        data: [],
        backgroundColor: 'rgba(53, 208, 127, 0.6)',
      },
      {
        label: 'Withdrawals',
        data: [],
        backgroundColor: 'rgba(255, 99, 132, 0.6)',
      },
    ],
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);

        // Fetch fund data
        const data = await getFundData();
        setFundData(data);

        // Fetch transaction history
        const history = await getTransactionHistory();
        setTransactions(history);

        // Process transaction data for chart
        const last7Days = Array.from({ length: 7 }, (_, i) => {
          const date = new Date();
          date.setDate(date.getDate() - i);
          return date.toISOString().split('T')[0];
        }).reverse();

        const depositsByDay = {};
        const withdrawalsByDay = {};

        last7Days.forEach(day => {
          depositsByDay[day] = 0;
          withdrawalsByDay[day] = 0;
        });

        history.forEach(tx => {
          const day = new Date(tx.timestamp).toISOString().split('T')[0];
          if (last7Days.includes(day)) {
            if (tx.type === 'deposit') {
              depositsByDay[day] += parseFloat(tx.amount);
            } else {
              withdrawalsByDay[day] += parseFloat(tx.amount);
            }
          }
        });

        setTransactionChart({
          labels: last7Days,
          datasets: [
            {
              label: 'Deposits',
              data: last7Days.map(day => depositsByDay[day]),
              backgroundColor: 'rgba(53, 208, 127, 0.6)',
            },
            {
              label: 'Withdrawals',
              data: last7Days.map(day => withdrawalsByDay[day]),
              backgroundColor: 'rgba(255, 99, 132, 0.6)',
            },
          ],
        });

        setLoading(false);
      } catch (err) {
        console.error('Error fetching fund data:', err);
        setError('Failed to load fund data');
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-celo-green"></div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
        <strong className="font-bold">Error!</strong>
        <span className="block sm:inline"> {error}</span>
      </div>
    );
  }

  return (
    <div>
      <h1 className="text-2xl font-semibold text-gray-900">Fund Dashboard</h1>

      {/* Fund Stats */}
      <div className="mt-6 grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-4">
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <dt className="text-sm font-medium text-gray-500 truncate">Total Supply</dt>
            <dd className="mt-1 text-3xl font-semibold text-gray-900">{parseFloat(fundData.totalSupply).toFixed(2)}</dd>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <dt className="text-sm font-medium text-gray-500 truncate">Total Shares</dt>
            <dd className="mt-1 text-3xl font-semibold text-gray-900">{parseFloat(fundData.totalShares).toFixed(2)}</dd>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <dt className="text-sm font-medium text-gray-500 truncate">Deposits</dt>
            <dd className="mt-1 text-3xl font-semibold text-gray-900">
              {transactions.filter(tx => tx.type === 'deposit').length}
            </dd>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <dt className="text-sm font-medium text-gray-500 truncate">Withdrawals</dt>
            <dd className="mt-1 text-3xl font-semibold text-gray-900">
              {transactions.filter(tx => tx.type === 'withdrawal').length}
            </dd>
          </div>
        </div>
      </div>

      {/* Charts */}
      <div className="mt-8 grid grid-cols-1 gap-5 sm:grid-cols-2">
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <h3 className="text-lg font-medium leading-6 text-gray-900">Transaction Distribution</h3>
            <div className="mt-5 h-64">
              <Pie 
                data={{
                  labels: ['Deposits', 'Withdrawals'],
                  datasets: [
                    {
                      data: [
                        transactions.filter(tx => tx.type === 'deposit').length,
                        transactions.filter(tx => tx.type === 'withdrawal').length
                      ],
                      backgroundColor: [
                        'rgba(53, 208, 127, 0.6)',
                        'rgba(255, 99, 132, 0.6)',
                      ],
                      borderColor: [
                        'rgba(53, 208, 127, 1)',
                        'rgba(255, 99, 132, 1)',
                      ],
                      borderWidth: 1,
                    },
                  ],
                }} 
                options={{ maintainAspectRatio: false }} 
              />
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <h3 className="text-lg font-medium leading-6 text-gray-900">Transaction Activity (Last 7 Days)</h3>
            <div className="mt-5 h-64">
              <Bar 
                data={transactionChart} 
                options={{ 
                  maintainAspectRatio: false,
                  scales: {
                    y: {
                      beginAtZero: true,
                    }
                  }
                }} 
              />
            </div>
          </div>
        </div>
      </div>

      {/* Transaction History */}
      <div className="mt-8">
        <h3 className="text-lg font-medium leading-6 text-gray-900">Recent Transactions</h3>

        {transactions.length === 0 ? (
          <div className="mt-6 bg-white shadow overflow-hidden sm:rounded-md">
            <div className="px-4 py-5 sm:p-6 text-center text-gray-500">
              No transactions found. This could be because the contract is new or doesn't have the expected events.
            </div>
          </div>
        ) : (
          <div className="mt-6 bg-white shadow overflow-hidden sm:rounded-md">
            <ul className="divide-y divide-gray-200">
              {transactions.slice(0, 10).map((tx, index) => (
                <li key={index}>
                  <div className="px-4 py-4 sm:px-6">
                    <div className="flex items-center justify-between">
                      <div className="flex items-center">
                        <div className={`flex-shrink-0 h-10 w-10 rounded-full ${tx.type === 'deposit' ? 'bg-green-100' : 'bg-red-100'} flex items-center justify-center`}>
                          <span className={`text-${tx.type === 'deposit' ? 'green' : 'red'}-600 font-medium`}>
                            {tx.type === 'deposit' ? '+' : '-'}
                          </span>
                        </div>
                        <div className="ml-4">
                          <div className="text-sm font-medium text-celo-dark">
                            {tx.type === 'deposit' ? 'Deposit' : 'Withdrawal'}
                          </div>
                          <div className="text-sm text-gray-500">
                            {tx.user.substring(0, 6)}...{tx.user.substring(tx.user.length - 4)}
                          </div>
                        </div>
                      </div>
                      <div className="ml-2 flex-shrink-0 flex">
                        <div className="text-sm text-gray-900 font-medium">
                          {parseFloat(tx.amount).toFixed(4)} CELO
                        </div>
                        <span className={`ml-2 px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${tx.type === 'deposit' ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'}`}>
                          {tx.type === 'deposit' ? 'Deposit' : 'Withdrawal'}
                        </span>
                      </div>
                    </div>
                    <div className="mt-2 sm:flex sm:justify-between">
                      <div className="sm:flex">
                        <div className="mt-2 flex items-center text-sm text-gray-500 sm:mt-0">
                          <svg className="flex-shrink-0 mr-1.5 h-5 w-5 text-gray-400" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor">
                            <path fillRule="evenodd" d="M6 2a1 1 0 00-1 1v1H4a2 2 0 00-2 2v10a2 2 0 002 2h12a2 2 0 002-2V6a2 2 0 00-2-2h-1V3a1 1 0 10-2 0v1H7V3a1 1 0 00-1-1zm0 5a1 1 0 000 2h8a1 1 0 100-2H6z" clipRule="evenodd" />
                          </svg>
                          {new Date(tx.timestamp).toLocaleString()}
                        </div>
                      </div>
                      <div className="mt-2 flex items-center text-sm text-gray-500 sm:mt-0">
                        <a 
                          href={`https://explorer.celo.org/alfajores/tx/${tx.transactionHash}`} 
                          target="_blank" 
                          rel="noopener noreferrer"
                          className="text-celo-green hover:underline"
                        >
                          View on Explorer
                        </a>
                      </div>
                    </div>
                  </div>
                </li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </div>
  );
}
